{"po_long_text":["Blank CD"],"inspection_long_text":[],"mara_matnr":"000000000000000638","basic_long_text":["The Notebook Basic 15 is a notebook that offers strong multimedia capabilities at an affordable price. The Basic 15 has a futuristic design, a 15 inch display and uses high-quality components. The option of rebuilding and customizing the notebook is available with the use of Interchangeable case parts."]}
{"po_long_text":["Blank CD"],"inspection_long_text":[],"mara_matnr":"000000000000000638","basic_long_text":["Featuring the same futuristic design as is common in the Basic HT series; this notebook is eye-catching as well as having a high technical specification. The Basic 17 features a 17 inch display which provides a greater cinematic experience for those multimedia users. It will fit in the majority of briefcases and also features a thinner case. This notebook is extremely light for its size which sets the Basic 17 apart from other notebooks."]}
{"po_long_text":["Blank CD"],"inspection_long_text":[],"mara_matnr":"000000000000000638","basic_long_text":["The Pro 15 is at the forefront of mobile computing. The notebook provides outstanding processing power, has an impressive 15 inch high- resolution display and this is all within razor-thin dimensions. The thin case means that you can have the satisfaction of having a powerful but fully mobile notebook without the hassle of carrying a large notebook."]}
{"po_long_text":["Blank CD"],"inspection_long_text":[],"mara_matnr":"000000000000000638","basic_long_text":["The Pro 17 is truly a remarkable notebook. The large 17 inch display gives film fanatics a taste of home cinema. The razor-thin dimensions mean that this notebook is lightweight, easy to carry as well as being pleasing to the eye. The Pro 17 has the highest technical specification in the HT series to suit all of your multimedia needs."]}
{"po_long_text":["Blank CD"],"inspection_long_text":[],"mara_matnr":"000000000000000640","basic_long_text":["This notebook will enchant you. It not only fulfils the desire for digital mobility, but also it leaves enough space in your luggage, thanks to its slim dimensions. It's amazing that you don't have to do without the satisfaction of a 15-inch display."]}
{"po_long_text":["Blank CD"],"inspection_long_text":[],"mara_matnr":"000000000000000640","basic_long_text":["The Easy Hand III is a powerful Handheld device. This handheld has wireless capabilities with built-in Wi-Fi which allows users to surf the Internet and check emails on the go! The Easy Hand III comes with a 5 mega-pixel camera that provides high-quality photos and video. The handheld also supports MP3 and several other audio formats including .wav and .wma files."]}
{"po_long_text":["Blank CD"],"inspection_long_text":[],"mara_matnr":"000000000000000578","basic_long_text":["The Easy Hand V is a handheld touch screen device with a vibrant color display. Like the Easy Hand III, the Easy Hand V has built in Wi-Fi but now features an upgraded camera for high-definition recording too! The Easy Hand V runs the Nafdon mobile engine and is capable of running mobile Nafdon applications. Carry the power of your PC in your back pocket with the Easy Hand V!"]}
{"po_long_text":["Blank CD"],"inspection_long_text":[],"mara_matnr":"000000000000000598","basic_long_text":["The flat handheld PC with increased performance and functionality. For the mobile office and mobile Internet."]}
{"po_long_text":["Blank CD"],"inspection_long_text":[],"mara_matnr":"000000000000000599","basic_long_text":["The HT-1023 or Easy Power is a touch screen Smartphone with a lot to offer! The Easy Power has a navigation key for scrolling through menu\u2018s as well as allowing the user to scroll via touch screen using hand movements. This smartphone has a very high quality 7 Mega-pixel camera as well as Wi-Fi, 3G, and Bluetooth. At current, the Easy Power is the most advanced smartphone on the market."]}
{"po_long_text":["Blank CD"],"inspection_long_text":[],"mara_matnr":"000000000000000637","basic_long_text":["The Ergo Screen is a 21\u201d widescreen monitor. This monitor comes with an integrated USB-Hub to provide users with additional connection ports. It is ergonomically designed so that the USB ports are easy to access and they have been positioned so that connected USB cables do not overhang and obstruct the view of the screen. The Ergo screen is an innovative product and provides an excellent picture quality at a reasonable price!"]}
{"po_long_text":["Blank CD"],"inspection_long_text":[],"mara_matnr":"000000000000000637","basic_long_text":["The Easy Pixel or HT-1031 is a 19 inch LCD TFT widescreen monitor. The screen incorporates a thin layer of anti-glare glass which offers a viewing angle of 170 degrees horizontally and 160 degrees vertically. The Easy Pixel is suitable for those with visual impairments as it offers the clearest picture of our monitors."]}
{"po_long_text":["Blank CD"],"inspection_long_text":[],"mara_matnr":"000000000000000637","basic_long_text":["The Beam Screen is a monitor with a 23 inch LCD widescreen display. As well as an impressive screen size, the Beam Screen also features a USB hub which is built-in to the monitor stand. The USB hub is surrounded by loudspeakers that output 12 RMS per speaker. The Beam screen is an all- in-one solution for multimedia users that have the issue of limited desk space."]}
{"po_long_text":["Blank CD"],"inspection_long_text":[],"mara_matnr":"000000000000000637","basic_long_text":["The Flat Basic 17 features a 17 inch TFT display and is perfect for those on a smaller budget. The monitor features a high resolution and for the price, it is very good value for money. The Flat Basic 17 is still an outstanding purchase and the resolution and picture quality is impressive to say the least!"]}
{"po_long_text":["Blank CD"],"inspection_long_text":[],"mara_matnr":"000000000000000640","basic_long_text":["With a 20 inch display and a futuristic design, the Flat Future stands out in the market for computer monitors. The monitor stand also acts as a cable tidy where the Video cable can be packaged and stored within the stand. This is the future of flat screen monitors."]}
{"po_long_text":["Blank CD"],"inspection_long_text":[],"mara_matnr":"000000000000000640","basic_long_text":["The Flat XL features an enormous 24 inch screen display. This monitor is actually 1mm thinner than the Flat future and the screen only has a thin border which gives the illusion that it is virtually edgeless. Despite these thin dimensions, the Flat XL has an excellent build quality as the monitor stand is very sturdy and solid."]}
{"po_long_text":["Blank CD"],"inspection_long_text":[],"mara_matnr":"000000000000000641","basic_long_text":["The Laser Eco provides a professional printing solution and is a suitable Laser Printer for large offices or workplaces. It prints only in black and white and has 3 trays for paper to ensure that it won\u2018t run out anytime soon. The Laser Eco saves on electricity costs with its auto-standby mode which means that it runs at very low power when not in use."]}
{"po_long_text":["DEMO CD"],"inspection_long_text":[],"mara_matnr":"000000000000000641","basic_long_text":["The Laser Basic provides a basic printing solution all user groups. The Laser Basic is suitable for home as well as office use. The Laser Basic only prints in black and white but it prints at a remarkable speed. For a fast and reliable printing solution, buy the Laser Basic!"]}
{"po_long_text":["DEMO CD"],"inspection_long_text":[],"mara_matnr":"000000000000000641","basic_long_text":["The Laser Allround is a multi-purpose Laser Printer that also prints in colour. It features a built in Scanner and Fax machine. The Laser Allround is an excellent printer and is suitable for large organisations of home-owners that require high quality Laser printing with additional functionality such as scanner/fax."]}
{"po_long_text":["DEMO CD"],"inspection_long_text":[],"mara_matnr":"000000000000000641","basic_long_text":["With the Deskjet Super Color you get a versatile color printer with a USB port for print demands in any work environment. It generates pin-sharp text as well as photographic quality, even on normal paper."]}
{"po_long_text":["DEMO CD"],"inspection_long_text":[],"mara_matnr":"000000000000000641","basic_long_text":["The Deskjet Mobile is a high-performance printer that convinces with its portability. Its extra dependability and robustness guarantee many years of use in any work environment."]}
{"po_long_text":["DEMO CD"],"inspection_long_text":[],"mara_matnr":"000000000000000641","basic_long_text":["The Deskjet Highspeed will convince you with its impressive speed. It combines outstanding print performance with the ultimate in photo quality, thereby ensuring efficient work of the highest quality."]}
{"po_long_text":["DEMO CD"],"inspection_long_text":[],"mara_matnr":"000000000000000642","basic_long_text":["The Laser Multi Print incorporates a Scanner and colour printer in one. You can meet all of your publishing requirements with this printer. It is suitable for large offices as well as home use where a scanner is required. The Multi Print comes 2 black ink cartridges only. Colour Ink cartridges will need to be purchased seperately."]}
{"po_long_text":["DEMO CD"],"inspection_long_text":[],"mara_matnr":"000000000000000642","basic_long_text":["The Multi color is an excellent all-round printer. It prints in a whole range of different colours as well as including a fax machine and scanner. The Multi Color also prints in A3 and has an A3 paper tray built in. The Multi Color has memory card slots so users can print out pictures on their SD cards direct from the printer console via a touchscreen on the printer. The Multi Color is a serious printer and is suitable for companies in the printing business!"]}
{"po_long_text":["DEMO CD"],"inspection_long_text":[],"mara_matnr":"000000000000000642","basic_long_text":["The Cordless Mouse is a basic wireless mouse for those on a budget. It comes with a USB wireless receiver and Requires 2 AAA batteries. (Batteries not included). It uses 2.4GHZ wireless connectivity to ensure that it tracks as smoothly as any wired mouse on the market. The Cordless Mouse has an auto power off feature to save battery life when the mouse is idle."]}
{"po_long_text":["DEMO CD"],"inspection_long_text":[],"mara_matnr":"000000000000000642","basic_long_text":["The Speed Mouse is a wired optical mouse for use with Desktop PCs and Notebooks. It does not require any drivers to work and is therefore plug and play. The Speed Mouse has an ergonomic design and features a strong build quality."]}
