{"po_long_text":["Long text mat78"],"inspection_long_text":[],"mara_matnr":"000000000000001417","basic_long_text":["Gary E. Varner presents a carefully argued response to what he characterizes as \"two dogmas of environmentalism\" - the assumptions that animal rights philosophies and anthropocentric views are each antithetical to sound environmental policy. He defends a \"biocentric individualist\" stance that gives priority to the lives of animals with conscious desires and to certain human interests and shows that such a view is able to support the goals on the environmentalist agenda."]}
{"po_long_text":["Long text mat79"],"inspection_long_text":[],"mara_matnr":"000000000000001417","basic_long_text":["Arthur Madigan presents a clear, accurate new translation of the third book (Beta) of Aristotle's Metaphysics, together with two related chapters from the eleventh book (Kappa). Madigan's accompanying introduction and commentary give detailed guidance to these texts, in which Aristotle sets out the main questions of metaphysics and assesses the main answers to them,and which serve as a useful introduction not just to Aristotle's own work on metaphysics but to classical metaphysics in general."]}
{"po_long_text":["Long text mat80"],"inspection_long_text":[],"mara_matnr":"000000000000001417","basic_long_text":["David Charles presents a study of Aristotle's views on meaning, essence,necessity, and related topics. These interconnected views are central to Aristotle's metaphysics, philosophy of language, and philosophy of science. They are also highly relevant to current debates in philosophy of language. Charles aims, on the basis of a careful reading of Aristotle's texts and many subsequent works, to reach a clear understanding of his claims and arguments,and to assess their truth and their importance to philosophy ancient and modern."]}
{"po_long_text":["Long text mat81"],"inspection_long_text":[],"mara_matnr":"000000000000001427","basic_long_text":["These new translations of the Defence of Socrates, the Euthyphro,and the Crito present Plato's remarkable dramatizations of the momentous events surrounding the trial of Socrates in 399 BC, on charges of irreligion and corrupting the young. They form a dramatic and thematic sequence,raising fundamental questions about the basis of moral, religious, legal, and political obligation. The introduction provides a stimulating philosophical and historical analysis of these texts, complemented by useful explanatory notes and an index of names."]}
{"po_long_text":["Long text mat82"],"inspection_long_text":[],"mara_matnr":"000000000000001467","basic_long_text":["Anonymous characters -- such as Lot's wife, Jephthah's daughter,Pharoah's baker, and the witch of Endor -- are ubiquitous in the Hebrew Bible, and appear in a wide variety of roles. Adele Reinhartz here answers two principal questions concerning this aspect of biblical narrative. First,is there a \"poetics of anonymity,\" and if so, what are its contours? Second, how does anonymity affect the readers' response to, and construction of,unnamed biblical characters. She is especially interested in issues related to gender,determining whether female characters are more likely to be anonymous than male characters, and whether the anonymity of female characters functions differently from that of male characters."]}
{"po_long_text":["Long text mat83"],"inspection_long_text":[],"mara_matnr":"000000000000001478","basic_long_text":["First published in hardback in August 1985, Professor Fishbane's book offers the first comprehensive analysis of the phenomenon of textual analysis in ancient Israel.  It explores the rich tradition of exegesis prior to the development of biblical interpretation in early classical Judaism and the earliest Christian communities, and examines four main categories of exegesis: scribal, legal, aggadic, and mantological. In studying this subject, it emerges that the Hebrew Bible is not only the foundation document for the exegetical culture of Judaism and Christianity, but an exegetical work in its own right.Professor Fishbane, who has added new material in appendices to this paperback edition, has been awarded three major prizes for this work: the National Jewish Book Award 1986, the Biblical Archaeological Society 1986 Publication Award, and the Kenneth B. Smilen Literary Award."]}
{"po_long_text":["Long text mat84"],"inspection_long_text":[],"mara_matnr":"000000000000001479","basic_long_text":["Who were the scribes who copied early Christian literature    during the second and third centuries? What roles did they  play in the reproduction and dissemination of these writings? To answer these questions, this study uses evidence from early Christian literature and the earliest Christian papyri - including their form, physical features,and textual characteristics."]}
{"po_long_text":["Long text mat85"],"inspection_long_text":[],"mara_matnr":"000000000000001547","basic_long_text":["The Muratorian Fragment, as traditionally dated, is the earliest known list of books of the New Testament. This book offers a redating of the fragment that recasts the entire history of the development of the Christian Bible."]}
{"po_long_text":["Long text mat86"],"inspection_long_text":[],"mara_matnr":"000000000000001547","basic_long_text":["This controversial new book argues that Jesus, like many of his later followers, proclaimed that God was soon to intervene in human affairs and bring all of history to a screeching halt. Through a careful evaluation of the New Testament Gospels and other surviving sources, including the more recently discovered Gospels of Thomas and Peter, Ehrman shows why Jesus should be understood as an apocalyptic prophet who anticipated the destruction of evil, the end of the age, and b eginning of a new world - not 2000 years after his lifetime, but in less than 30."]}
{"po_long_text":["Long text mat87"],"inspection_long_text":[],"mara_matnr":"000000000000001548","basic_long_text":["Original and provocative study of Marx's communism and List's theory of nationalism. Examines the relationship between the two dominant ideologies which emerged during the nineteenth century.Offers a major reinterpretation of Marxism's historical development. This is the story of the enduring relationship between communism and nationalism that extended beyond 1848 into the 20th century, had enormous implications for Russia in 1917, and still lies at the heart of debates over the importance of allegiance to nation as opposed to social class, the choice between internationalism and national independence, and the role of communism in developing countries."]}
{"po_long_text":["Long text mat88"],"inspection_long_text":[],"mara_matnr":"000000000000001548","basic_long_text":["This unprecedented survey and analysis of government is planetary in its reach. The late S.E. Finer's tour de force demonstrates the breadth of imagination and magisterial scholarship which characterized the work of one of the twentieth century's leading political scientists."]}
{"po_long_text":["Long text mat89"],"inspection_long_text":[],"mara_matnr":"000000000000001549","basic_long_text":["This book is a collection of articles from leading researchers in three broad areas: capital-investment theory, development and welfare economics, and issues related to capitalismn and socialism. It contains a comprehensive overview of the relevant literature and a good coverage of recent developments in each field. Contributors include Paul A. Samuelson, Amartya Sen, T.N. Srinivasan, Jan Tinbergen, Amit Bhaduri, Amitava Bose and Pranab Bardhan,among others."]}
{"po_long_text":["Long text mat90"],"inspection_long_text":[],"mara_matnr":"000000000000001549","basic_long_text":["A philosophical account of an economic system that avoids both the moral failings of capitalism and the inefficiencies of socialism."]}
{"po_long_text":["Long text mat91"],"inspection_long_text":[],"mara_matnr":"000000000000001657","basic_long_text":["A new and thought-provoking study of marriage and the law in late antiquity, looking particularly at the new legislation enacted by the emperor Constantine (reigned AD 307-337). Famously the first Christian emperor did his laws reflect Christian ideals, or pagan practice?"]}
{"po_long_text":["Long text mat92"],"inspection_long_text":[],"mara_matnr":"000000000000001658","basic_long_text":["This book explores the ways in which law seeks to accommodate tensions between commitment and freedom in marriage. On the one hand, spouses are members of a shared community, while on the other they are discrete individuals with their own distinct interests. Regan suggests that only close attention to context can guide us in deciding what weight to assign to each dimension of spousal identity in a given setting. This interdisciplinary work has relevance to family law, family studies, feminist legal theory, and the debate between liberal and communitarian social theorists."]}
{"po_long_text":["Long text mat93"],"inspection_long_text":[],"mara_matnr":"000000000000001700","basic_long_text":["This book is a concise introduction to topics in commutative algebra, with an emphasis on worked examples and applications. It combines elegant algebraic theory with applications to number theory, problems in classical Greek geometry, and the theory of finite fields which has important uses in other branches of science.  Topics covered include rings and Euclidean rings, the four-squares theorem, fields and field extensions, finite cyclic groups, and finite fields.  The material covered in this book prepares the way for the further study of abstract algebra, but it could also form the basis of an entire course."]}
{"po_long_text":["Long text mat94"],"inspection_long_text":[],"mara_matnr":"000000000000001707","basic_long_text":["Now available in paperback, this successful radical approach to complex analysis replaces the standard calculational arguments with new geometric ones. With several hundred diagrams, and far fewer prerequisites than usual, this is the first visual intuitive introduction to complex analysis. Although designed for use by undergraduates in mathematics and science, the novelty of the approach will also interest professional mathematicians."]}
{"po_long_text":["Long text mat95"],"inspection_long_text":[],"mara_matnr":"000000000000001718","basic_long_text":["The science of virology is now at the fore front of medical microbiology, due in part, to the emergence of AIDS and other viral infections.  This book provides a very readable richly illustrated, and attractively presented account of a highly technical but essential subject in medical education."]}
{"po_long_text":["Long text mat96"],"inspection_long_text":[],"mara_matnr":"000000000000001737","basic_long_text":["This fascinating book shows how viruses, with their amazing ability to mutate, have caused devastating diseases in the past, and continue to provide one of the greatest challenges to science. With viruses often overdramatised in the media, the author seeks to provide an accurate account of these nimble parasites, and to address the question of whether a virus might eventually eliminate the human race."]}
